ressen gespeichert. Das erfolgt zur Sicherheit, falls jemand widerrechtliche Inhalte verfasst (Beleidigungen, links- oder rechtsextreme Propaganda, Hasspostings usw.). In diesem Fall sind wir an der Identitt des Verfassers interessiert.</p>\n<h4>Cookies</h4>\n<p>Cookies sind kleine Dateien, die es dieser Webseite ermglichen auf dem Computer des Besuchers spezifische, auf den Nutzer bezogene Informationen zu speichern, whrend unsere Website besucht wird. Cookies helfen uns dabei, die Nutzungshufigkeit und die Anzahl der Nutzer unserer Internetseiten zu ermitteln, sowie unsere Angebote fr Sie komfortabel und effizient zu gestalten. Wir verwenden einerseits Session-Cookies, die ausschlielich fr die Dauer Ihrer Nutzung unserer Website zwischengespeichert werden und zum anderen permanente Cookies, um Informationen ber Besucher festzuhalten, die wiederholt auf unsere Website zugreifen. Der Zweck des Einsatzes dieser Cookies besteht darin, eine optimale Benutzerfhrung anbieten zu knnen sowie Besucher wiederzuerkennen und bei wiederholter Nutzung eine mglichst attraktive Website und interessante Inhalte prsentieren zu knnen. Der Inhalt eines permanenten Cookies beschrnkt sich auf eine Identifikationsnummer. Name, IP-Adresse usw. werden nicht gespeichert. Eine Einzelprofilbildung ber Ihr Nutzungsverhalten findet nicht statt. Eine Nutzung unserer Angebote ist auch ohne Cookies mglich. Sie knnen in Ihrem Browser das Speichern von Cookies deaktivieren, auf bestimmte Webseiten beschrnken oder Ihren Webbrowser (Chrome, IE, Firefox,) so einstellen, dass er sie benachrichtigt, sobald ein Cookie gesendet wird. Sie knnen Cookies auch jederzeit von der Festplatte ihres PC lschen. Bitte beachten Sie aber, dass Sie in diesem Fall mit einer eingeschrnkten Darstellung der Seite und mit einer eingeschrnkten Benutzerfhrung rechnen mssen.</p>\n<h4>Datenschutzerklrung fr Google Analytics</h4>\n<p>Diese Website benutzt Google Analytics, einen Webanalysedienst der Google Inc. (Google). Google A